import {Routes, Route, Navigate} from 'react-router-dom';
import { useMemo, useState } from "react";
import { CssBaseline, ThemeProvider } from "@mui/material";
import { createTheme } from "@mui/material/styles";
import { themeSettings } from "./theme";
import Navbar from './components/navbar';
import Homepage from './pages/homepage';
import Register from './pages/register';
import Login from './pages/login';
import {Toaster} from "react-hot-toast";
import Summary from './pages/Summary';
import Paragraph from './pages/paragraph';
import Chatbot from './pages/Chatbot';
import Timecomplexity from './pages/timecomplexity';
import Grammar from './pages/grammar';
import Sql from './pages/sql';

function App() {
  const theme = useMemo(() => createTheme(themeSettings()), []);
  const [isLoggedIn, setIsLoggedIn] = useState(localStorage.getItem("authToken") === "true");

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
    localStorage.removeItem("authToken");
  };
  return (
    <>
    <ThemeProvider theme={theme}>
        <CssBaseline />
        <Navbar isLoggedIn={isLoggedIn} onLogout={handleLogout} />
        <Toaster/>
        <Routes>
          <Route path="/" element={isLoggedIn ? <Navigate to="/homepage" /> : <Navigate to="/login" />}/>

            <Route path="/register" element={<Register/>} />
            <Route
            path="/login"
            element={<Login onLogin={handleLogin} />}
          />
          <Route path="/homepage" element={<Homepage />} />
            <Route path="/summary" element={<Summary/>} />
            <Route path="/paragraph" element={<Paragraph/>} />
            <Route path="/Chatbot" element={<Chatbot/>} />
            <Route path="/timecomplexity" element={<Timecomplexity/>} />
            <Route path="/grammar" element={<Grammar/>} />
            <Route path="/sql" element={<Sql/>} />
        </Routes>
      </ThemeProvider>
    </>
  );
}

export default App;
